import React, {useState} from 'react';
import './Dashboard.css';
import 'bootstrap/dist/css/bootstrap.css';
import {NavLink} from "react-router-dom";



const Dashboard =() => {

    const [inactive, setInactive] = useState(false);

    return(
        <div className={`side-menu ${inactive ?  'inactive' : '' }`}>
            <div className={"top-section"}>
                <div className={'logo'}>
                    <img src={require('../images/MicrosoftTeams-image (1).png')} />
                </div>
                <div className={'toggle-menu'}>
                    <button onClick={() => setInactive(!inactive)} className={'btn'}>
                        {
                            inactive ? <i className="zmdi zmdi-caret-left-circle"> </i> : <i className="zmdi zmdi-caret-right-circle"> </i>
                        }

                    </button>

                    <div className={'dashboard-name'}>
                        <h4> Dashboard </h4>
                    </div>
                    <div className={'divider'}> </div>


                    <div className={'main-menu'}>
                        <ul >
                            <li>
                                <NavLink className="nav-link" to="/leads">Leads <span className="sr-only">(current)</span></NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink className="nav-link" to="/reports">Reports</NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink className="nav-link" to="/profile">Profiles</NavLink>
                            </li>
                        </ul>
                    </div>

                </div>
            </div>

            {/*<div className={'divider'}> </div>*/}


        </div>
    )
}

export default Dashboard;
